      self.CurrencyCode:str = obj["CurrencyCode"]
      self.DocBurUnitCost:int = obj["DocBurUnitCost"]
      self.DocLbrUnitCost:int = obj["DocLbrUnitCost"]
      self.DocMtlBurUnitCost:int = obj["DocMtlBurUnitCost"]
      self.DocMtlUnitCost:int = obj["DocMtlUnitCost"]
